import React, {useState, useEffect} from 'react'

const UserProfile = () => {
    const [columns, setColumns] = useState([]);
    const [record, setRecord] = useState();


    useEffect(() => {
        fetch('http://localhost:8000/users/user/1')
        .then(res => res.json())
        .then(data => {
            setColumns(Object.keys(data.user))
            setRecord(data.user)
        })
        .catch(error => console.error(error));
    }, []);

  return (
    <div>
        <h2>Users</h2>
        <table className='table'>
            <thead>
                <tr>
                    {columns.map((c, i) => (
                        <th key={i}>{c}</th>
